@factsanddata @ASlavitt Fingers crossed, yes. 🤞 

At least for variants through Delta. There is always the possibility of variants with enough divergence that the current vaccine becomes insufficiently effective. 

In that case regular boosters, as for influenza, might be needed. But not yet.

